const Loading = (props) => {
	return (
		<div
			style={{
				width: "10vh",
				height: "10vh",
				display: "flex",
				justifyContent: "center",
				alignItems: "center",
			}}
			className="spinner-border text-primary"
			role="status"
		>
			<span className="visually-hidden">Loading...</span>
		</div>
	);
};

export default Loading;
